import React from "react";
import { useSpring, animated } from "react-spring";

const Check = () => {
  const props = useSpring({
    from: { opacity: 0, transform: "scale(0.5)" },
    to: { opacity: 1, transform: "scale(1)" },
    config: { duration: 500 },
  });

  return (
    <div className="check-animation-container">
      <animated.div style={props}>
        <svg
          xmlns="http://www.w3.org/2000/svg"
          width="80"
          height="80"
          fill="#5cb85c"
          className="bi bi-check-circle"
          viewBox="0 0 16 16"
        >
          <path
            fillRule="evenodd"
            d="M8 0a8 8 0 1 1 0 16A8 8 0 0 1 8 0zm3.97 4.97a.75.75 0 0 0-1.06-1.06L7 9.94 5.09 8.03a.75.75 0 1 0-1.06 1.06l2.5 2.5a.75.75 0 0 0 1.06 0l4.5-4.5z"
          />
        </svg>
      </animated.div>
      <p className="success-message">Payment Successful!</p>
    </div>
  );
};

export default Check;
